import React from 'react';
import './App.css';
import { BrowserRouter as Router, Route } from "react-router-dom";
import Product from './Product';

function App() {
  return (
    <Router>
        <main>
          <nav>
            <ul>
              <li><a href="/">Home</a></li>
              <li><a href="/product">Product</a></li>
            </ul>
          </nav>

      <Route path="/product" render={() => <Product />} />
        </main>
    </Router>
  );
}

export default App;
